import "./contact.scss"
import emailjs from "emailjs-com";


const Contact = () => {
    function sendEmail(e){
        e.preventDefault();

        emailjs.sendForm('service_czrtuyj', 'template_60f9ioq', e.target, 'user_6lvljyPRltrXndg1r5pcL').then(res=>{console.log(res);
        }).catch(err=> console.log(err));
    }
    return (
        <div className='contact' id="contact">
            <div className="left">
                <img src="assets/mail4.png" height="300px" className="contact"/>
            </div>
            <div className="right">
                <h1>Contact me.</h1>
                <p>Don´t hesitate to contact me! I’d love to hear about what you’re working on and find a way to work together.</p>

                <form className="contact-form">

                    <input type="text" name="name" placeholder="Name"/>
                    <input type="email" name="user_email" placeholder="Email" />
                    <textarea name="message" rows="4" placeholder="Message" />

                    <input type="submit" value="Send" />
                </form>
            </div>
        </div>

    );
};

export default Contact;
